import { Map, GoogleApiWrapper } from 'google-maps-react'
import React, { Component } from 'react'

const mapStyles = {
  width: '100%',
  height: '100%',
}

export class MapContainer extends Component<{ google: any }> {
  render(): any {
    return <Map google={this.props.google} style={mapStyles} initialCenter={{ lat: -1.2884, lng: 36.8233 }} />
  }
}

export default GoogleApiWrapper({ apiKey: 'asd' })(MapContainer)
